room.onPlayerChat = function(player,message){
    if(player.admin == true){
	if(message.toLowerCase().split(" ")[0] == commands.admin){
	    room.setPlayerAdmin(player.id,!player.admin);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.commands){
	    room.sendAnnouncement("Available commands: !circuit [ID], !discord, !help, !map, !maps",player.id,colors.commands,fonts.commands,sounds.commands);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.discord){
	    room.sendAnnouncement("Entre no nosso Discord e venha participar da Fórmula TOH!",null,colors.info,"bold",sounds.info);
	    room.sendAnnouncement("Link: https://discord.gg/sCfhQWpbE",null,colors.info,"normal",sounds.info);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.laps){
	    let number = message.toLowerCase().split(" ")[1];
	    if (number >= 1){
		limit = number;
		var players = room.getPlayerList();
	        players.forEach(p => {
			for(let i=playerList[p.name].currentLap; i<limit; i++){
			playerList[p.name].lapTimes.push(0);
    			}
   		 });
	    }
	    else{
		room.sendAnnouncement(`Número inválido de voltas`,player.id,colors.mapLoadDeny,fonts.mapLoadDeny,sounds.mapLoadDeny);
	    }
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapInfo){
	    room.sendAnnouncement(`${_Circuit.Name} best lap: ${serialize(_Circuit.BestTime[0])} seconds by ${_Circuit.BestTime[1]}`,player.id,colors.mapInfo,fonts.mapInfo,sounds.mapInfo);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapLoad){
	    var id = message.toLowerCase().split(" ")[1];

	    if(id < 1 || id > _Circuits.length){
		room.sendAnnouncement(`Invalid ID`,player.id,colors.mapLoadDeny,fonts.mapLoadDeny,sounds.mapLoadDeny);
	    }
	    else{
		room.setCustomStadium(Circuits[id-1]);
		room.sendAnnouncement(`${_Circuits[id-1].Name} was loaded by ${player.name}`,null,colors.mapLoad,fonts.mapLoad,sounds.mapLoad);
	    }
	    
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.maps){
	    room.sendAnnouncement(`Map list below:\n${_Circuits.map(c => c.Name + " [" + c.ID + "]").join('\n')}`,player.id,colors.info,fonts.info,sounds.info);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.qualy){
	    if(sendRecWebhookURL != ""){
       		room.startRecording();
        	room.sendAnnouncement("📢Você pode assistir o replay da sua qualificatória no Discord",player.id,colors.info,"bold",sounds.info);
    	}
	    return false;
	}
	else if(message.toLowerCase() == commands.safetyoff){
	    generalSafetyCar = false;
	    room.sendAnnouncement(`⚠️ ALERTA DE SAFETY CAR!! ⚠️`, null, 0x00FF00, "bold", sounds.safety);
	    room.sendAnnouncement(`🚨 O Safety Car está DESLIGADO 🚨`, null, 0x00FF00, "bold", sounds.safety);

	    return false;
	}
	else if(message.toLowerCase() == commands.safetyon){
	    generalSafetyCar = true;
	    limit += 1;
	    room.sendAnnouncement(`⚠️ ALERTA DE SAFETY CAR!! ⚠️`, null, 0xFFFF00, "bold", sounds.safety);
	    room.sendAnnouncement(`🚨 O Safety Car está LIGADO 🚨`, null, 0xFFFF00, "bold", sounds.safety);
	    var players = room.getPlayerList();
	        players.forEach(p => {
			for(let i=playerList[p.name].currentLap; i<limit; i++){
			playerList[p.name].lapTimes.push(0);
    			}
   		 });

	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.speed){
	    playerList[player.name].speedEnabled = !playerList[player.name].speedEnabled;
	    // room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);
	    return false;
	}
    }
    else{
	if(message.toLowerCase().split(" ")[0] == commands.admin){
	    room.setPlayerAdmin(player.id,!player.admin);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.commands){
	    room.sendAnnouncement("Available commands: !admin, !commands, !map, !speed",player.id,colors.commands,fonts.commands,sounds.commands);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.discord){
	    room.sendAnnouncement("Entre no nosso Discord e venha participar da Fórmula TOH!",player.id,colors.info,"bold",sounds.info);
	    room.sendAnnouncement("Link: https://discord.gg/tUS332xC",player.id,colors.info,"normal",sounds.info);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.mapInfo){
	    room.sendAnnouncement(`${_Circuit.Name} best lap: ${serialize(_Circuit.BestTime[0])} seconds by ${_Circuit.BestTime[1]}`,player.id,colors.mapInfo,fonts.mapInfo,sounds.mapInfo);
	    return false;
	}
	else if(message.toLowerCase().split(" ")[0] == commands.speed){
	    playerList[player.name].speedEnabled = !playerList[player.name].speedEnabled;
	    // room.sendAnnouncement(`Speed is turned ${speedEnableChanges[Number(playerList[player.name].speedEnabled)]}`,player.id,colors.speed,fonts.speed,sounds.speed);
	    return false;
	}
    }
}

room.onPlayerKicked = function(kickedPlayer,reason,ban,byPlayer){
    byPlayer == null ? console.log(`${kickedPlayer.name} ${playerKicked[Number(ban)]} (${reason})`) : console.log(`${kickedPlayer.name} ${playerKicked[Number(ban)]} by ${byPlayer.name} (${reason})`);
}

room.onPlayerJoin = function(player){
    console.log(`${player.name} has joined`);
    let players = room.getPlayerList();

    let lapTimes = [];
    for(let i=0; i<limit; i++){
	lapTimes.push(0);
    }

    playerList[player.name] = {name: player.name, id: player.id, currentLap: 0, lapChanged: false, delta: 0, drsChanged: false, lapTimes: lapTimes, speedEnabled: false, inSafetyCar: false, isInTheRoom: true, isInTheTrack: false};

    if(room.getScores() == null && players.length == 1){
	if(_Circuit.Team != 0)
	    room.setPlayerTeam(player.id,_Circuit.Team);

	room.startGame();
    }
}

room.onPlayerLeave = function(player){
    console.log(`${player.name} has left`);
    let players = room.getPlayerList();

    playerList[player.name].currentLap = 0;
    playerList[player.name].lapChanged = false;
    playerList[player.name].drsChanged = false;
    playerList[player.name].inSafetyCar = false;
    playerList[player.name].isInTheRoom = false;
    playerList[player.name].isInTheTrack = false;

    if(room.getScores() != null && players.length == 0){
	room.stopGame();
    }
}

room.onPlayerTeamChange = function(changedPlayer,byPlayer){
    byPlayer == null ? console.log(`${changedPlayer.name} was moved to ${teams[changedPlayer.team]}`) : console.log(`${changedPlayer.name} was moved to ${teams[changedPlayer.team]} by ${byPlayer.name}`);
    console.log(changedPlayer);
    if(changedPlayer.team != 0) {
	playerList[changedPlayer.name].isInTheTrack = true;
    }
    else {
	playerList[changedPlayer.name].isInTheTrack = false;
    }
    // changedPlayer.team != 0 ? playerList[changedPlayer.name].isInTheTrack = false : playerList[changedPlayer.name].isInTheTrack = true;
    playerList[changedPlayer.name].currentLap = 0;
    playerList[changedPlayer.name].lapChanged = false;
}

room.onPositionsReset = function(){
    let players = room.getPlayerList();
    players.forEach(p => {
	playerList[p.name].currentLap = 0;
	playerList[p.name].lapChanged = false;
	for(let l=0; l<playerList[p.name].lapTimes.length; l++){
	    playerList[p.name].lapTimes[l] = 0;
	}
    });
}

